import React from "react";
import "./App.css";

function NyListItem (){
  const listArray =  [1,2,3,4,5,6];
  return (
    <>
      <ul class="list-group">
        {listArray.length === 0
          ? "No records to show.."
          : listArray.map((item, i) => {
            <li>
                List item 1
              </li>
            })}
      </ul>
    </>
  );
};

export default NyListItem;
